(2731, 27, 1, 1366, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Les patients signalent parfois qu\'ils présentent les symptômes suivants. Veuillez indiquer la sévérité des symptômes que vous avez ressentis lors de la dernière semaine.&lt;/span&gt;&lt;/p&gt;&lt;!--StartFragment--&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;Les réponses que vous apportez fourniront à votre médecin un aperçu de votre santé et vous feront gagner du temps lors de votre rendez-vous. Si vous avez des questions ou si vous avez des doutes, veuillez en informer votre médecin.&lt;/p&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-01-17 11:01:49', 'hpatrick', '2020-01-17 16:22:57', 'hpatrick'),
(2732, 27, 2, 1366, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Patients sometimes report that they have the following symptoms or problems. Please indicate the extent to which you have experienced these symptoms or problems during the past week.&lt;/span&gt;&lt;/p&gt;&lt;!--StartFragment--&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;The answers you provide will provide your physician with a snapshot of your health and will save time during your appointment. If you have any questions or are unsure of an answer, please let your physician know.&lt;/p&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-01-17 11:01:49', 'hpatrick', '2020-01-17 16:22:57', 'hpatrick'),
