(2929, 27, 1, 1465, '&lt;p&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;THIS IS A DRAFT QUESTIONNAIRE DO NOT PUBLISH WITHOUT FULL APPROVAL &lt;/span&gt;&lt;/p&gt;&lt;!--StartFragment--&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Les patients signalent parfois qu\'ils présentent les symptômes suivants lorsqu\'ils reçoivent une radiothérapie pour un &lt;b&gt;cancer situé dans le bassin&lt;/b&gt; (par ex. prostate, vessie, colorectal). Veuillez indiquer la sévérité des symptômes que vous avez ressentis lors de la dernière semaine.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;Les réponses que vous apportez fourniront à votre médecin un aperçu de votre santé et vous feront gagner du temps lors de votre rendez-vous. Si vous avez des questions ou si vous avez des doutes, veuillez en informer votre médecin.&lt;/p&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-02-25 08:53:53', 'hpatrick', '2020-02-25 14:10:16', 'hpatrick'),
(2930, 27, 2, 1465, '&lt;p&gt;THIS IS A DRAFT QUESTIONNAIRE DO NOT PUBLISH WITHOUT FULL APPROVAL.&lt;/p&gt;&lt;!--StartFragment--&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;&lt;span style=&quot;font-size: 14px;float: none;&quot;&gt;Patients sometimes report that they have the following symptoms or problems when receiving radiotherapy for a &lt;b&gt;cancer located in the pelvis&lt;/b&gt; (eg. prostate, bladder, colorectal). Please indicate the extent to which you have experienced these symptoms or problems during the past week.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;font-size: 14px;&quot;&gt;The answers you provide will provide your physician with a snapshot of your health and will save time during your appointment. If you have any questions or are unsure of an answer, please let your physician know.&lt;/p&gt;&lt;!--EndFragment--&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-02-25 08:53:53', 'hpatrick', '2020-02-25 14:10:16', 'hpatrick'),
