(8421, 27, 1, 4208, '&lt;p&gt;Vous avez reçu un diagnostic positif pour la COVID-19. Vous êtes invité à remplir ce questionnaire chaque jour pendant 14 jours. En complétant ce questionnaire à tous les jours, vous fournirez des informations importantes sur vos symptômes et vos signes vitaux.  Ces informations seront revues par une infirmière à tous les jours pour évaluer vos besoins en termes de soins.  Ce questionnaire fournira aussi des conseils importants. &lt;br/&gt; &lt;br/&gt;Si vous n’êtes pas en mesure de remplir ce questionnaire par vous-même, il peut être complété par quelqu’un d’autre.&lt;/p&gt;&lt;p&gt;Si vous présentez un des symptômes suivants, allez directement à la salle d’urgence la plus près ou appelez le 911.  Mentionnez que vous êtes une personne avec la COVID-19.&lt;/p&gt;', 0, '', '2020-06-13 11:51:57', 'MACFARIA', '2020-06-13 15:51:57', 'MACFARIA'),
(8422, 27, 2, 4208, '&lt;p&gt;You have been diagnosed with COVID-19. You are invited to complete this questionnaire each day for 14 days. By completing this questionnaire daily, you provide important information on your symptoms and vital signs. This information is looked at by a nurse every day to evaluate your care needs. The questionnaire will also provide you with important advice. &lt;br/&gt; &lt;br/&gt;If you are unable to complete the questionnaire yourself, someone else may complete it for you. &lt;/p&gt;&lt;p&gt;If you have any of the following symptoms, go directly to your nearest emergency department or call 911. Mention that you are a person with COVID-19.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-06-13 11:51:57', 'MACFARIA', '2020-06-13 15:51:57', 'MACFARIA'),
