(9039, 27, 1, 4517, '&lt;p&gt;Vous avez reçu un diagnostic positif pour la COVID-19. Vous êtes invité à remplir ce questionnaire chaque semaine pendant 14 jours. En complétant ce questionnaire chaque semaine, vous fournirez des informations importantes sur vos symptômes et vos signes vitaux.  Ces informations seront revues par une infirmière à toutes les semaines pour évaluer vos besoins en termes de soins.  Ce questionnaire fournira aussi des conseils importants. &lt;br/&gt; &lt;br/&gt;Si vous n’êtes pas en mesure de remplir ce questionnaire par vous-même, il peut être complété par quelqu’un d’autre.&lt;/p&gt;&lt;p&gt;Si vous présentez un de ces symptômes, allez directement à la salle d’urgence la plus près ou appelez le 911.  Mentionnez que vous êtes une personne avec la COVID-19.&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-06-15 16:39:22', 'MACFARIA', '2020-06-15 20:39:22', 'MACFARIA'),
(9040, 27, 2, 4517, '&lt;p&gt;You have been diagnosed with COVID-19. You are invited to complete this questionnaire each week for 14 days. By completing this questionnaire weekly, you provide important information on your symptoms and vital signs. This information is looked at by a nurse every week to evaluate your care needs. The questionnaire will also provide you with important advice. &lt;br/&gt; &lt;br/&gt;If you are unable to complete the questionnaire yourself, someone else may complete it for you. &lt;/p&gt;&lt;p&gt;If you have any of these symptoms, go directly to your nearest emergency department or call 911. Mention that you are a person with COVID-19.&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-06-15 16:39:22', 'MACFARIA', '2020-06-15 20:39:22', 'MACFARIA'),
