(9105, 23, 1, 4550, 'Test MF - Avez-vous perdu votre odorat?\n\nSi vous avez répondu oui, ne traitez pas avec des corticostéroïdes inhalés ou oraux.  Ceci pourrait aider à propager le virus.  Évitez-les si vous pouvez.  Contactez l’infirmière pour obtenir plus d’information.', 1, 'MACFARIA', '2020-07-16 17:29:44', 'MACFARIA', '2020-07-19 18:25:00', 'MACFARIA'),
(9106, 23, 2, 4550, 'Test MF - Have you lost your sense of smell?\n\nIf you answered yes, do not treat it with inhaled or oral corticosteroids. This could help the virus spread. Avoid it if you can. Contact the nurse if you want more information.', 1, 'MACFARIA', '2020-07-16 17:29:44', 'MACFARIA', '2020-07-19 18:25:00', 'MACFARIA'),
