(12109, 27, 1, 6052, '&lt;p&gt;Les patients signalent parfois qu\'ils présentent les symptômes suivants lorsqu\'ils reçoivent une radiothérapie pour un cancer situé dans le bassin (par ex. prostate, vessie, colorectal). Veuillez indiquer la sévérité des symptômes que vous avez ressentis depuis votre dernier rendez-vous.&lt;br/&gt;&lt;br/&gt;Les réponses que vous apportez fourniront à votre médecin un aperçu de votre santé et vous feront gagner du temps lors de votre prochain rendez-vous avec votre médecin. Ils peuvent également vous aider à suivre votre état de santé pendant votre traitement. Si vous avez des questions ou si vous avez des doutes, veuillez en informer votre médecin.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-26 12:38:59', 'hpatrick', '2020-08-28 22:03:24', 'hpatrick'),
(12110, 27, 2, 6052, '&lt;p&gt;Patients sometimes report that they have the following symptoms or problems when receiving radiotherapy for a cancer located in the pelvis (eg. prostate, bladder, colorectal). Please indicate the extent to which you have experienced these symptoms or problems since your last appointment.&lt;br/&gt;&lt;br/&gt;The answers you provide will provide your physician with a snapshot of your health and will save time during your next appointment with your physician. They can also help you track your health during your treatment. If you have any questions or are unsure of an answer, please let your physician know.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-26 12:38:59', 'hpatrick', '2020-08-28 22:03:24', 'hpatrick'),
