(12203, 27, 1, 6099, '&lt;p&gt;&lt;i&gt;Les domaines suivants peuvent rendre difficile de prendre vos médicaments pour le VIH, tels que prescrits.&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;br/&gt;&lt;u&gt;Au cours des 4 dernières semaines&lt;/u&gt;, à quelle fréquence ces domaines ont-ils rendu difficile la prise de vos médicaments pour le VIH ? Par difficile, nous entendons que la prise de vos médicaments a été soit sautée, retardée ou très déplaisante. &lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;br/&gt;Notez votre réponse de 1 à 10. &lt;/i&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-26 22:58:15', 'yuanchao', '2020-08-27 02:58:15', 'yuanchao'),
(12204, 27, 2, 6099, '&lt;p&gt;&lt;i&gt;The following areas of life can make it difficult to take your HIV medication, as prescribed. ​&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;br/&gt;&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;&lt;u&gt;​&lt;/u&gt;&lt;/i&gt;&lt;i&gt;&lt;u&gt;In the past 4 weeks&lt;/u&gt;, how often did these areas make it difficult to take your HIV medication? By difficult, we mean that taking your medication was either skipped, delayed or very unpleasant. &lt;/i&gt;&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&lt;p&gt;&lt;i&gt;Mark your response from 1 to 10. &lt;/i&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-26 22:58:15', 'yuanchao', '2020-08-27 02:58:15', 'yuanchao'),
