(12281, 27, 1, 6138, '&lt;p&gt;Les patient(e)s rapporteront fréquemment qu\'après certaines chirurgies, ils/elles ressentent de la douleur. Votre chirurgien(ne) plasticien(ne) aimerait surveiller l\'étendue de votre douleur et la quantité d\'analgésique dont vous avez besoin pour suivre vos progrès. Vos réponses seront examinées avec vous lors de votre rendez-vous de suivi.&lt;br/&gt;&lt;/p&gt;', 0, '', '2020-08-27 13:32:03', 'briana', '2020-08-27 17:32:03', 'briana'),
