(14534, 27, 2, 7264, 'e-IMPAQc Research Consent', 0, '', '2020-10-22 08:55:27', 'MACFARIA', '2020-10-22 12:55:27', 'MACFARIA'),
(14535, 27, 1, 7265, '&lt;p&gt;Les informations que vous fournirez lors de l’utilisation de l’application mobile Opal peuvent être utiles à des fins de recherche, par exemple, la connaissance des symptômes les plus fréquemment rencontrés par les patients atteints de cancer. Voici ce que vous devriez savoir :&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Les informations vous concernant seront consultées uniquement par le personnel de recherche autorisé par le Comité d’éthique de la recherche de St. Mary.&lt;/li&gt;&lt;li&gt;Toutes les informations obtenues auprès de vous via cette application resteront strictement confidentielles. Votre identité ou toute autre information pouvant vous identifier ne sera révélée dans aucun rapport, publication ou présentation. Vos données pourront également être utilisées pour promouvoir le projet e-IMPAQc, pour une analyse plus approfondie liée à l’étude ou pour aider au développement de futures recherches. &lt;/li&gt;&lt;li&gt;Il n’y a pas d’avantage à donner votre consentement pour l’utilisation de vos données à des fins de recherche; cependant, vous pouvez éventuellement aider d’autres patients en fournissant ces informations (par exemple, cela pourrait nous aider à comprendre quand les symptômes sont plus graves et comment aider les gens à faire face aux symptômes).&lt;/li&gt;&lt;li&gt;Vous ne recevrez pas de compensation financière pour votre participation.&lt;/li&gt;&lt;/ul&gt;', 0, '', '2020-10-22 08:55:27', 'MACFARIA', '2020-10-26 18:55:45', 'MACFARIA'),
(14536, 27, 2, 7265, '&lt;p&gt;The information that you will provide when using the Opal mobile application may be helpful for research purposes, such as knowing which symptoms are most frequently experienced by patients with cancer. You should know that:&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Your information will only be viewed by research staff who have been given permission to do so by St. Mary’s Research Ethics Committee&lt;/li&gt;&lt;li&gt;All information obtained from you through this application will be kept strictly confidential. Your identity or any other identifying information will not be revealed in any reports, publications, or presentations. Your data may also be used to promote the e-IMPAQc project, for further analysis related to the study, or to help in the development of future research studies.&lt;/li&gt;&lt;li&gt;You should not expect any benefits from providing consent for use of your data for research purposes; however, you may eventually help other patients by providing this information (e.g., might help us understand when symptoms are more severe and what might help people cope with symptoms)&lt;/li&gt;&lt;li&gt;You will not be offered compensation for your participation.&lt;br/&gt;&lt;/li&gt;&lt;/ul&gt;', 0, '', '2020-10-22 08:55:27', 'MACFARIA', '2020-10-22 13:44:31', 'MACFARIA'),
