(22619, 27, 1, 10298, '&lt;p&gt;Le Groupe Informatique Opal Santé (l\'équipe de recherche derrière Opal) cherche à obtenir l\'opinion de patients, de cliniciens et de chercheurs dans un projet de recherche. Le groupe explore le développement d’un processus qui permettra aux patients intéressés de donner leurs données médicales pour la recherche dans l’application Opal. Nous aimerions avoir votre opinion pour façonner ce processus. Le groupe de discussion des patients sera tenu entre le 21 et le 23 juin 2021.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-06-07 07:47:52', 'CABR6008', '2021-06-07 11:47:52', 'CABR6008'),
(22620, 27, 2, 10298, '&lt;p&gt;The Opal Health Informatics Group (the research team behind Opal) is seeking patients, clinicians, and researchers to provide feedback regarding a research project. The group is exploring development of a process to allow interested patients to donate their medical data for research via the Opal app. We would like to hear your opinion to help us shape the process. The patient focus group will be held between June 21 and 23, 2021.&lt;br/&gt;&lt;/p&gt;', 0, NULL, '2021-06-07 07:47:52', 'CABR6008', '2021-06-07 11:47:52', 'CABR6008'),
