(24184,	27,	2,	20048,	'[FOR TESTING ONLY] Databank Consent Questionnaire',	0,	NULL,	'2023-09-22 10:39:05',	'AGKE6000',	'2023-09-22 14:39:18',	'AGKE6000'),
(24186,	27,	1,	20049,	'&lt;p&gt;À TITRE D\'ESSAI UNIQUEMENT, NON APPROUVÉ PAR LES REBELLES. Nous avons besoin de quelques informations de votre part pour assurer la sécurité et la confidentialité de vos données. Voici comment cela fonctionne :&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Collecte d\'informations:&lt;/b&gt; Nous vous demanderons quelques informations de base, comme votre nom complet, votre lieu et votre date de naissance. Nous disposons déjà de certaines de ces informations lorsque vous vous êtes inscrit(e) chez Opal.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Création d\'un identifiant unique:&lt;/b&gt; nous utilisons ces informations pour créer un code spécial qui vous représente. Ce code est un peu comme un surnom - il vous représente, mais ne contient aucune de vos informations personnelles.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;La sécurité de vos données:&lt;/b&gt; Nous utilisons ce surnom pour étiqueter vos données au lieu de votre nom réel. Ainsi, vos données personnelles restent confidentielles et toutes vos informations sont en sécurité.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Processus à sens unique:&lt;/b&gt; La création de ce pseudonyme est une opération à sens unique. Une fois qu\'il a été créé, il n\'y a aucun moyen de le retransformer en vos données personnelles. Cela signifie que même nous ne pouvons pas savoir à qui les informations appartenaient à l\'origine.&lt;br/&gt;&lt;br/&gt;Nous prenons votre vie privée au sérieux et ce processus nous permet de garantir la sécurité de vos données.&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2023-09-22 10:39:05',	'AGKE6000',	'2023-09-22 14:39:18',	'AGKE6000'),
(24187,	27,	2,	20049,	'&lt;p&gt;FOR TESTING ONLY, NOT REB APPROVED. We need a little bit of information from you to help keep your data safe and private. Here’s how it works:&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Collecting Information:&lt;/b&gt; We’ll ask you for some basic details like your full name and where and when you were born. We already have some of this info from when you registered with Opal.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Creating a Unique ID:&lt;/b&gt; We use these details to create a special code that represents you. This code is kind of like a nickname – it stands for you, but doesn’t contain any of your personal information.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;Keeping Your Data Safe:&lt;/b&gt; We use this nickname to label your data instead of your actual name. This way, your personal details stay private, and all your information is safe.&lt;br/&gt;&lt;br/&gt;&lt;b&gt;One-Way Process:&lt;/b&gt; Creating this nickname is a one-way operation. Once it’s made, there’s no way to turn the nickname back into your personal details. This means even we can’t see who the information originally belonged to.&lt;br/&gt;&lt;br/&gt;We take your privacy seriously, and this process helps us ensure your data is secure.&lt;br/&gt;&lt;/p&gt;',	0,	NULL,	'2023-09-22 10:39:05',	'AGKE6000',	'2023-09-22 14:39:18',	'AGKE6000'),
