(2381, 27, 1, 1191, '&lt;p&gt;Les patients signalent parfois qu\'ils pr&eacute;sentent les sympt&ocirc;mes suivants. Veuillez indiquer la s&eacute;v&eacute;rit&eacute; des sympt&ocirc;mes que vous avez ressentis lors de la derni&egrave;re semaine.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2382, 27, 2, 1191, '&lt;p&gt;Patients sometimes report that they have the following symptoms or problems. Please indicate the extent to which you have experienced these symptoms or problems during the past week.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2383, 27, 1, 1192, '&lt;p&gt;Ce court questionnaire vous permet de donner votre avis sur vos exp&amp;eacute;riences lors de l’utilisation de l’application Opal. Vos r&amp;eacute;ponses nous aideront &amp;agrave; am&amp;eacute;liorer davantage Opal.&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-12 09:57:28', 'jvyas'),
(2384, 27, 2, 1192, '&lt;p&gt;This short questionnaire allows you to provide feedback about your experiences using Opal. Your responses will help us further improve Opal.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2379, 27, 1, 1190, '&lt;p&gt;&lt;span style="font-size: 14px;float: none;"&gt;Les patients signalent parfois qu\'ils pr&eacute;sentent les sympt&ocirc;mes suivants. Veuillez indiquer la s&eacute;v&eacute;rit&eacute; des sympt&ocirc;mes que vous avez ressentis lors de la derni&egrave;re semaine.&lt;/span&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2380, 27, 2, 1190, '&lt;p&gt;&lt;span style="font-size: 14px;float: none;"&gt;Patients sometimes report that they have the following symptoms or problems. Please indicate the extent to which you have experienced these symptoms or problems during the past week.&lt;/span&gt;&lt;!--EndFragment--&gt;&lt;br/&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2399, 27, 1, 1200, '&lt;p&gt;&lt;span style="font-size: 14px;float: none;"&gt;L\'&eacute;quipe de d&eacute;veloppement d\'Opal est en train de d&eacute;velopper une extension d\'Opal appel&eacute;e OpalCare. OpalCare vous permettra de partager en toute s&eacute;curit&eacute; tout ou une partie de: vos rendez-vous, informations de stationnement, r&eacute;sultats de tests sanguins, documents cliniques, mat&eacute;riel &eacute;ducatif, etc. avec votre ou vos proches aidants. Un proche aidant est une connaissance personnelle (un membre de votre famille, un ami ou un voisin, par exemple) qui vous aide &agrave; r&eacute;pondre &agrave; certains de vos besoins en lien avec votre cancer. Nous sollicitons votre contribution afin de nous aider &agrave; d&eacute;velopper OpalCare. Merci de prendre quelques minutes pour r&eacute;pondre &agrave; ce bref sondage.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2400, 27, 2, 1200, '&lt;p&gt;&lt;span style="font-size: 14px;float: none;"&gt;The Opal development team is in the process of developing an extension of Opal called OpalCare. OpalCare will allow you to securely share some or all of: your appointments, parking information, blood test results, clinical documents, educational material, etc. with your personal caregiver(s). A personal caregiver is a personal acquaintance (ie. family member, friend, neighbour) who is helping you with any of your cancer needs. We are seeking your input in order to help us to design OpalCare. Thank you for for taking a few minutes to complete this brief survey.&lt;/span&gt;&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2393, 27, 1, 1197, '&lt;p&gt;Les patients peuvent d&eacute;montrer des probl&egrave;mes de peau pendant et apr&egrave;s le traitement de radioth&eacute;rapie. R&eacute;pondez vous-m&ecirc;me &agrave; toutes les questions en choissisant le chiffre qui correspond le mieux &agrave; votre situation au cours de la derni&egrave;re journ&eacute;e.&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2394, 27, 2, 1197, '&lt;p&gt;Patients may report skin problems during and after radiation therapy. Please indicate the extent to which you have experienced these symptoms during the past day by selecting the number that best applies to you.&lt;br/&gt;&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2415, 27, 1, 1208, '&lt;p&gt;Votre radio-oncologue, soit le Dr Faria, Hijal ou Kopek, aimerait que vous remplissiez ce questionnaire. Vos réponses seront examinées par votre radio-oncologue et utilisées pour orienter votre rendez-vous. À la fin de votre rendez-vous, vos réponses seront ajoutées à votre dossier.&lt;/p&gt;&lt;p&gt;L\'objectif de ce questionnaire est d\'évaluer le fonctionnement de vos intestins. Veuillez sélectionner une seule réponse à chaque question. Il se peut qu\'il soit difficile de ne sélectionner qu\'une seule réponse, puisque vos symptômes peuvent varier d\'un jour à l\'autre. C\'est pourquoi nous vous prions de choisir la réponse qui décrit le mieux votre expérience de vie au quotidien. Si vous avez récemment eu une infection affectant vos intestins, veuillez ne pas en tenir compte et répondre de façon à refléter du mieux possible le fonctionnement de vos intestins au quotidien.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 10:20:26', 'QUESTIONNAIRE_MIGRATION_2019'),
(2416, 27, 2, 1208, '&lt;p&gt;Your Radiation Oncologist (either Dr. Faria, Dr. Hijal, or Dr. Kopek) has requested that you please complete this questionnaire. The answers you provide will be viewed by your Radiation Oncologist and used to help focus your appointment. At the end of your appointment, they will be added to your file.&lt;/p&gt;&lt;p&gt;The aim of this questionnaire is to assess your bowel function. Please select only one response for each question. It may be difficult to select only one answer, as symptoms may vary from day to day. However, we would kindly ask you to choose the one answer which best describes your daily life. If you have recently had an infection affecting your bowel function, please do not take this into account and focus on answering the questions to reflect your usual daily bowel function.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-12 10:05:40', 'jvyas'),
(2419, 27, 1, 1210, '&lt;p&gt;&Eacute;tude sur les mat&eacute;riels &eacute;ducatifs: Invitation &agrave; participer &agrave; une &eacute;tude&lt;/p&gt;&lt;p&gt;Cher Utilisateur d’Opal,&lt;/p&gt; &lt;p&gt;Ce message est pour vous informer d’une &eacute;tude qui prendra place au Centre du cancer des C&egrave;dres. Le projet de recherche est men&eacute; par une infirmi&egrave;re et l’objectif est d’explorer vos pens&eacute;es par rapport aux mat&eacute;riels &eacute;ducatifs qui vous sont fourni dans l’application Opal.&lt;/p&gt;&lt;p&gt;Si vous aimeriez en savoir d’avantage, veuillez lire l’information ci-dessous.&lt;/p&gt;&lt;p&gt;Merci,&lt;/p&gt;&lt;p&gt;L’&eacute;quipe de d&eacute;veloppement Opal&lt;/p&gt;&lt;p&gt;****************************************&lt;/p&gt;&lt;p&gt;Bonjour, je m’appelle Katherine Mohsen, je suis infirmi&egrave;re et je m&egrave;ne un projet de recherche dans le cadre de ma maitrise. Mon objectif est de mieux comprendre comment les patients, tel que vous-m&ecirc;mes, acc&eacute;dez et utilisez les mat&eacute;riels &eacute;ducatifs qui vous sont fourni dans Opal. Nous esp&eacute;rons que cette &eacute;tude nous donnera une id&eacute;e de votre exp&eacute;rience avec Opal.&lt;/p&gt;&lt;p&gt;Si vous acceptez de participer, votre participation comprendra une entrevue d’une dur&eacute;e de 30 &agrave; 60 minutes en personne &agrave; l’h&ocirc;pital ou au t&eacute;l&eacute;phone &agrave; une heure qui vous convient. L’entrevue sera enregistr&eacute;e. Toutes informations que vous contribuez sera conserv&eacute;es d’une mani&egrave;re confidentielle. &Agrave; tous moments, vous aurez le droit de refuser de r&eacute;pondre &agrave; n’importe quelle question, d’arr&ecirc;ter l’entrevue ou de vous retirer de cette &eacute;tude.&lt;/p&gt;&lt;p&gt;Une fois l’entrevue termin&eacute;e, vous recevrez une carte cadeau d’une valeur de 10$. Si vous stationnez dans le stationnement de l’h&ocirc;pital, sur pr&eacute;sentation du re&ccedil;u, vous recevrez un coupon qui vous permettra de quitter le stationnement sans frais.&lt;/p&gt;&lt;p&gt;Les entrevues prendront place de septembre &agrave; novembre 2019.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
(2420, 27, 2, 1210, '&lt;p&gt;Educational Material Research Study: An invitation to participate in research about Opal&lt;/p&gt;&lt;p&gt;Dear Opal User,&lt;/p&gt;&lt;p&gt;This message is to inform you of a new research study taking place at the Cedars Cancer Centre. The research study is being conducted by a nurse and the study\'s aim is to understand what your thoughts are about the education material provided to you in the Opal application.&lt;/p&gt;&lt;p&gt;If you would like to find out more, please read below.&lt;/p&gt;&lt;p&gt;Thank you,&lt;/p&gt;&lt;p&gt;The Opal Development Team&lt;/p&gt;&lt;p&gt;****************************************&lt;/p&gt;&lt;p&gt;Hello, my name is Katherine Mohsen, I am a nurse who is conducting a study as part of a master’s degree. My goal is to better understand how patients, such as yourself, access and use the educational material provided in Opal. We hope the study will give us some idea of your experience with Opal.&lt;/p&gt;&lt;p&gt;If you agree, your participation will involve a 30 to 60 minute interview in person at the hospital or over the phone at a time that is convenient for you. The interview will be audio recorded. Any information you provide will be kept confidential. You will have the right to refuse to answer any question during the interview. You will also have the right to stop participating in the study at any point.&lt;/p&gt;&lt;p&gt;Upon completion of the interview, you will receive a 10$ gift card. If you park in the hospital parking, we will arrange for a parking voucher for you to be able to exit upon presentation of the receipt.&lt;/p&gt;&lt;p&gt;The interviews will take place from September to November 2019.&lt;/p&gt;', 0, '', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019', '2019-11-07 09:23:51', 'QUESTIONNAIRE_MIGRATION_2019'),
